import React from "react";


const App = () => {
    return (
        <>
            <br />
            <h1>To Do List</h1>
            <br />
            <div className="input_btn">
                <input type="text" placeholder="Add Items" />
                <button></button>
            </div>
        </>
    );
};

export default App;
